      "3": "<p>A spring balance and a physical balance are kept in a lift. In these balances equal masses are placed. If now&nbsp; the lift starts moving upwards with constant acceleration, then:</p> <br>1. <p>The reading of spring balance will increase and the equilibrium position of the physical balance will disturb.</p> <br>2. <p>The reading of spring balance will remain unchanged and physical balance will remain in equilibrium.</p> <br>3. <p>The reading of spring balance will decrease and physical balance will remain in equilibrium</p> <br>4. <p>The reading of spring balance will increase and the physical balance will remain in equilibrium</p>",
