      "19": "<p>From Newton's second law of motion, it can be inferred that</p> <br>1. <p>No force is required to move a body uniformly along straight line</p> <br>2. <p>Accelerated motion is always due to an external force</p> <br>3. <p>Inertial mass of a body is equal to force required per unit acceleration in the body</p> <br>4. <p>All of these</p>",
