      "23": "<p>A boy hits a baseball with a bat and imparts an impulse J to the ball. The boy hits the ball again with the same force, except that the ball and the bat are in contact for twice the amount of time as in the first hit. The new impulse equals:</p> <br>1. <p>half the original impulse</p> <br>2. <p>the original impulse</p> <br>3. <p>twice the original impulse</p> <br>4. <p>&nbsp;four times the original impulse</p>",
